import {DetailsContainer} from "../../Styles/Details/Details.styled";

export default function Details(){
    return(
    <DetailsContainer>
        <div className="infoWrapper container">
            <h1>Details about Library Project!</h1>
                <p>Step into the heart of literary exploration as we journey into the depths of each book's essence. Here, every title is a portal to a world of knowledge, imagination, and inspiration.</p>
                <p>Dive into rich plot summaries that offer a glimpse into the captivating narratives awaiting discovery. From gripping mysteries to heartwarming tales of adventure, our detailed synopses provide a window into the stories that await within the pages.</p>
                <p>Explore the lives and works of beloved authors through insightful biographies that illuminate the paths that led to literary greatness. Gain a deeper understanding of the creative minds behind the words and the profound influences that shape their storytelling.</p>
                <p>Immerse yourself in the vibrant tapestry of critical reviews and reader feedback, spanning a spectrum of perspectives and interpretations. From scholarly analyses to personal reflections, each viewpoint adds layers of insight and understanding to the literary landscape.</p>
                <p>Experience literature in a new light with multimedia enhancements that bring the pages to life. Listen to audio excerpts that capture the essence of the narrative, watch video interviews with authors, and engage with interactive content that deepens your connection to the text.</p>
        </div>
    </DetailsContainer>);
}
